import React from "react";
import UserItem from './UserItem'

function UsersList(props) {
  return <ul>
    {props.allUsers.map((expense) => (
    <UserItem
    username={expense.username} //adding this key to deal with render times
    age={expense.age}

  />
    ))}
  </ul>;
}

export default UsersList;
